import React from "react";
import Logo from "./asset/logo.png";


const Header = () => {
  return (
    <div className="header">
      <div className="">
        <NestedList1 />
        <NestedList2 />
      </div>
      <div>
        <img src={Logo} alt="logo"></img>
      </div>
      <div className="">
        <NestedList3 />
        <NestedList4 />
      </div>
    </div>
  );
};

export default Header;
